import React from 'react';

const About = () => {
  return <div className='grid h-screen place-items-center'>
  <div className='container mx-auto'>
    <h1 className='text-[50px] text-beetwen p-8 gap-4'>About me</h1>
    <div className='text-lg flex  p-8 gap-20'>

    <p className='bg-gradient-to-r from-green-300 to-purple-300 border-2 border-blue-700 rounded-lg p-8 '>I'm excited to be starting my journey in web development. While I may not have any professional experience yet, I am passionate about learning and developing my skills in this field.</p>
    <p className='bg-gradient-to-r from-purple-300 to-green-300 border-2 border-blue-700 rounded-lg p-8'>I recently completed a FreeCodeCamp Course, where I earned some certifications. Since then, I've been building my own projects, experimenting with different technologies, and staying up-to-date with the latest trends in web development.</p>



    </div>
  </div>
  </div>;
};

export default About;
